const matchId = 194;  // Hardcoded für Test (später dynamisch)

const teamMapping = {
  163: 50,  // Frankfurt
  169: 45   // Gladbach
};

const items_out = [];

for (const item of items) {
  const responses = item.json.response;

  if (!responses || responses.length === 0) {
    console.log("Keine Statistics gefunden");
    continue;
  }

  for (const teamData of responses) {
    const externalTeamId = teamData.team.id;
    const internalTeamId = teamMapping[externalTeamId];

    if (!internalTeamId) {
      continue;
    }

    // Statistiken sammeln
    const stats = {
      match_id: matchId,
      team_id: internalTeamId
    };

    // Statistics Array parsen
    for (const stat of teamData.statistics) {
      const type = stat.type;
      let value = stat.value;

      // NULL-Handling
      if (value === null || value === undefined) {
        value = 0;
      }

      // String zu Integer konvertieren
      if (typeof value === 'string') {
        // Prozent-Werte (z.B. "63%")
        if (value.includes('%')) {
          value = parseInt(value.replace('%', ''));
        } 
        // Floats (z.B. "1.72")
        else if (value.includes('.')) {
          value = Math.round(parseFloat(value));  // Runden auf Integer
        }
        // Normale Zahlen
        else {
          value = parseInt(value) || 0;
        }
      }

      // Mapping zu DB-Spalten (exakte Namen!)
      const mapping = {
        'Shots on Goal': 'shots_on_goal',
        'Shots off Goal': 'shots_off_goal',
        'Total Shots': 'total_shots',
        'Blocked Shots': 'blocked_shots',
        'Shots insidebox': 'shots_insidebox',
        'Shots outsidebox': 'shots_outsidebox',
        'Fouls': 'fouls',
        'Corner Kicks': 'corner_kicks',
        'Offsides': 'offsides',
        'Ball Possession': 'ball_possession',
        'Yellow Cards': 'yellow_cards',
        'Red Cards': 'red_cards',
        'Goalkeeper Saves': 'goalkeeper_saves',
        'Total passes': 'total_passes',
        'Passes accurate': 'passes_accurate',
        'Passes %': 'passes_percentage'
      };

      const dbColumn = mapping[type];
      if (dbColumn) {
        stats[dbColumn] = value;
      }
    }

    items_out.push({ json: stats });
  }
}
return items_out;

