const matchId = 194;  // Hardcoded für Test (später dynamisch)

const teamMapping = {
  163: 50,  // Frankfurt
  169: 45   // Gladbach
};

const items_out = [];

for (const item of items) {
  const responses = item.json.response;

  if (!responses || responses.length === 0) continue;

  for (const teamData of responses) {
    const externalTeamId = teamData.team.id;
    const internalTeamId = teamMapping[externalTeamId];

    if (!internalTeamId) continue;

    for (const playerData of teamData.players) {
      const player = playerData.player;
      const stats = playerData.statistics[0];

      if (!stats || !stats.games) continue;

      const games = stats.games;
      const goals = stats.goals || {};
      const passes = stats.passes || {};
      const shots = stats.shots || {};
      const tackles = stats.tackles || {};
      const duels = stats.duels || {};
      const dribbles = stats.dribbles || {};
      const fouls = stats.fouls || {};
      const cards = stats.cards || {};
      const penalty = stats.penalty || {};

      items_out.push({
        json: {
          match_id: matchId,
          team_id: internalTeamId,
          player_id: player.id,
          player_name: player.name,

          // Game Info (KORRIGIERT)
          minutes_played: games.minutes || 0,
          number: games.number || null,
          position: games.position || null,
          rating: games.rating ? parseFloat(games.rating) : null,
          captain: games.captain || false,
          substitute: games.substitute || false,

          // Offsides
          offsides: stats.offsides || null,

          // Shots
          shots_total: shots.total || null,
          shots_on: shots.on || null,

          // Goals (KORRIGIERT)
          goals_total: goals.total || 0,
          goals_conceded: goals.conceded || null,
          goals_assists: goals.assists || 0,
          goals_saves: goals.saves || null,

          // Passes
          passes_total: passes.total || null,
          passes_key: passes.key || null,
          passes_accuracy: passes.accuracy ? parseInt(passes.accuracy) : null,

          // Tackles (KORRIGIERT)
          tackles_total: tackles.total || null,
          tackles_blocks: tackles.blocks || null,
          tackles_interceptions: tackles.interceptions || null,

          // Duels
          duels_total: duels.total || null,
          duels_won: duels.won || null,

          // Dribbles
          dribbles_attempts: dribbles.attempts || null,
          dribbles_success: dribbles.success || null,
          dribbles_past: dribbles.past || null,

          // Fouls
          fouls_drawn: fouls.drawn || null,
          fouls_committed: fouls.committed || null,

          // Cards (KORRIGIERT)
          cards_yellow: cards.yellow || 0,
          cards_red: cards.red || 0,

          // Penalty
          penalty_won: penalty.won || null,
          penalty_committed: penalty.commited || null,
          penalty_scored: penalty.scored || 0,
          penalty_missed: penalty.missed || 0,
          penalty_saved: penalty.saved || null
        }
      });
    }
  }
}

console.log(`✅ ${items_out.length} Spieler-Statistiken`);
return items_out;
